import React from "react";
import "./newsfeed.scss";
import News from "./news"
import newsfeeddata from "../../jsonData/newsfeeddata.json";

const Newsfeed = () => {
  return (
    <div className="newsfeed">
      <h3>Newsfeed</h3>
      {newsfeeddata.map((cours) => (
          <News name={cours.courseName} imgUrl={cours.imgUrl} info={cours.info} newCourse={cours.newCourse}/>

        ))}
        <div className="item1"> <News/></div>
        <div className="item2"> <News/></div>
    </div>
  );
};

export default Newsfeed;
